import React from "react";

const Home = () => {
    return(
        <div style={{display:'flex', justifyContent:'center', alignItems:'center', backgroundSize:'cover', height:'100vh'}}>
            <span>Welcome </span>
            <span>Digital Portfolio</span>
            <span>Project Search</span>
        </div>
    );
} 
export default Home;
